function pairElement(str) {
  let lettersArr = [];
  let dnaArr = [];
  // Split str to array
  lettersArr = str.split("");
  for(let i = 0; i < lettersArr.length; i++) {
    if(lettersArr[i] === "A") {
      dnaArr.push(["A", "T"]);
    }
    if(lettersArr[i] === "T") {
      dnaArr.push(["T", "A"]);
    }
    if(lettersArr[i] === "C") {
      dnaArr.push(["C", "G"]);
    }
    if(lettersArr[i] === "G") {
      dnaArr.push(["G", "C"]);
    }
  }
  return dnaArr;
}

